import { BrowserRouter, Routes, Route} from "react-router-dom";

import Login from "./page/Login";
import Home from "./page/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route index element={<Login/>}/>
        <Route  exact path="/" element={<Login/>}/>
        <Route exact path="/about" element={<Home/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
